import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

interface FormData {
  source: string;
  destination: string;
  budget: string;
  duration: string;
  interests: string;
  constraints: string;
  travelStyle: string;
  travelers: string;
}

const BookingFormPage: React.FC = () => {
  const [currentStep, setCurrentStep] = useState<number>(0);
  const [formData, setFormData] = useState<FormData>({
    source: '',
    destination: '',
    budget: '',
    duration: '',
    interests: '',
    constraints: '',
    travelStyle: '',
    travelers: '',
  });
  const [error, setError] = useState<string | null>(null);
  const navigate = useNavigate();

  const handleNext = (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    setCurrentStep((prev) => prev + 1);
  };

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    setError(null);
    // Transform formData to match backend TripRequest
    const payload = {
      source: formData.source,
      destination: formData.destination,
      budget: formData.budget,
      duration_days: Number(formData.duration),
      interests: formData.interests.split(',').map(s => s.trim()).filter(Boolean),
      constraints: formData.constraints,
      travel_style: formData.travelStyle,
      travelers: formData.travelers,
    };
    try {
      const response = await axios.post('http://localhost:8000/itinerary/generate', payload);
      navigate('/itinerary', { state: { itinerary: response.data } });
    } catch (err: any) {
      setError('Sorry, something went wrong while planning your trip. Please try again.');
    }
  };

  let stepContent;
  switch (currentStep) {
    case 0:
      stepContent = (
        <form onSubmit={handleNext}>
          <h2>Step 1: Where are you traveling?</h2>
          <div>
            <input
              type="text"
              name="source"
              placeholder="Source"
              value={formData.source}
              onChange={handleChange}
            />
          </div>
          <div>
            <input
              type="text"
              name="destination"
              placeholder="Destination"
              value={formData.destination}
              onChange={handleChange}
            />
          </div>
          <button type="submit">Next</button>
        </form>
      );
      break;
    case 1:
      stepContent = (
        <form onSubmit={handleNext}>
          <h2>Step 2: Budget & Duration</h2>
          <div>
            <input
              type="text"
              name="budget"
              placeholder="Budget"
              value={formData.budget}
              onChange={handleChange}
            />
          </div>
          <div>
            <input
              type="text"
              name="duration"
              placeholder="Duration (days)"
              value={formData.duration}
              onChange={handleChange}
            />
          </div>
          <button type="submit">Next</button>
        </form>
      );
      break;
    case 2:
      stepContent = (
        <form onSubmit={handleNext}>
          <h2>Step 3: Interests & Constraints</h2>
          <div>
            <input
              type="text"
              name="interests"
              placeholder="Interests"
              value={formData.interests}
              onChange={handleChange}
            />
          </div>
          <div>
            <input
              type="text"
              name="constraints"
              placeholder="Constraints"
              value={formData.constraints}
              onChange={handleChange}
            />
          </div>
          <button type="submit">Next</button>
        </form>
      );
      break;
    case 3:
      stepContent = (
        <form onSubmit={handleSubmit}>
          <h2>Step 4: Travel Style & Travelers</h2>
          <div>
            <input
              type="text"
              name="travelStyle"
              placeholder="Travel Style"
              value={formData.travelStyle}
              onChange={handleChange}
            />
          </div>
          <div>
            <input
              type="text"
              name="travelers"
              placeholder="Travelers"
              value={formData.travelers}
              onChange={handleChange}
            />
          </div>
          <button type="submit">Submit</button>
        </form>
      );
      break;
    default:
      stepContent = <h2>Thank you! Your trip is being planned.</h2>;
  }

  return (
    <div>
      {stepContent}
      {error && <div style={{ color: 'red', marginTop: 16 }}>{error}</div>}
    </div>
  );
};

export default BookingFormPage;
